import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
    profile :{
        backgroundImage : 'linear-gradient(90deg , #FFE00D , #FEA127)',
        height : '700px'
    },
    profileSVG:{
        position : 'absolute',
        bottom : '0'
    }
});
export default useStyles;
